import React from 'react'
import {Link} from 'react-router-dom'

export const DesicionList = ({ decisions }) => {
  if (!decisions.length) {
    return <p className="center">Рішень для оцінюванння немає</p>
  }

  return (
    <table>
      <thead>
      <tr>
        <th>№</th>
        <th>Название</th>
        <th>Автор</th>
        <th>Дата создания</th>
        <th>Ссылка</th>
      </tr>
      </thead>

      <tbody>
      {decisions.map((decision, index) => {
        return (
          <tr>
            <td>{index + 1}</td>
            <td>{decision._id}</td>
            <td>{decision.decisiveuseremail}</td>
            <td>
              <Link to={`/detail/${decisions._id}`}>Открыть</Link>
            </td>
          </tr>
        )
      }) }
      </tbody>
    </table>
  )
}
